import Link from 'next/link';

const linkStyle = {
    marginRight : 15
};
const layoutStyle = {
    marginTop: 10,
    marginBottom: 20,
    padding: 20,
    border: '1px solid #DDD'
  };

const Header = () => (
    <div style={layoutStyle}>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>
    </div>
);

export default Header;
